import React from "react";
import Button from 'react-bootstrap/Button';

function Home() {

  return (
    <div className="d-grid gap-2">
      <Button variant="primary" size="lg">
        Locations
      </Button>
      <Button variant="secondary" size="lg">
        All Venues
      </Button>
    </div>
  );
}

export default Home;
